import React from 'react';
import '../accountsettings.css';

const AccountSettings = () => {
    return (
        <div id="settings">
            <h1>Account Settings</h1>
            <div id="settingsDiv">
                <div id="leftPanel">
                    <div className="buttonText"><p>Edit Profile</p></div>
                    <div className="buttonText"><p style={{ marginTop: "20px" }}>Password</p></div>
                    <div className="buttonText"><p style={{ marginTop: "20px" }}>Notifications</p></div>
                    <div className="buttonText"><p style={{ marginTop: "20px" }}>Weather & Clothes Preference</p></div>
                    <div id="verticalLine"></div>
                </div>
            </div>
        </div>
    );
};

export default AccountSettings;
